import logo from './logo.svg';
import './App.scss';
import Home from './Home'
import DarkMode from './Navbar/darkMode';
import Navbar from './Navbar';
import { useState } from 'react';


function App(props) {

  let [darkMode, setDarkMode] = useState('modo-claro');    

  const changeMode = () =>  {
    if (darkMode === 'modo-claro'){
      setDarkMode('modo-escuro')         
              
    }
    else {
      setDarkMode('modo-claro')
           
    }
  
    }   

  
  
  const borders = {
    border: '1px solid red',
    cursor: 'pointer',
  }
 
  

  return (

    <div className="App" style={darkMode}>


      <Navbar> <div style={borders} onClick={changeMode}> <DarkMode/></div> </Navbar>
      
      <Home/>
      

    </div>
  );
}
export default App;
